/* eslint-disable jsx-a11y/iframe-has-title */
import React, { Component } from "react";
import '../../../css/Home.scss';
import '../../../css/Home.sass';

// import './JxSingapore2019.scss';
// import './JxSingapore2019.sass';
import Footer from "../../../global/Footer";
import JxAsiaCoverImg from "../../../../images/JxAsia2020/JxAsiaCoverImg.png"

// JunctionXAsia

import JunctionAsiaCollab from '../../../../images/JxAsia2020/JunctionXAsia_Poster.jpg'
import AsiaLogo from '../../../../images/JxAsia2020/junctionx_asia_white_twoline.png'

// For Router History
import { useHistory } from 'react-router-dom';



class JxSingapore2019 extends Component {


  render() {

    return (
      <div>
        {/* <div className="modal-position">
          { this.state.showModal ? <div onClick={this.close}></div> : null }
          <Modal 
            className="modal"
            show={this.state.showModal}
            close={this.close}>
              Maybe aircrafts fly very high because they don't want to be seen in plane sight?
          </Modal>
        </div> */}
        <div className="container">
          <div className="wrapperOne">
            <img src={JxAsiaCoverImg} className="coverPhotoTag"></img>
            <div className="containerOne">
              {/* <img className = "logoSize" src={JunctionAsiaPoster} alt= "JunctionAsiaPoster"/> */}
              {/* <p className = "headerLogo">JUNCTIONX ASIA</p> */}
              <img src={AsiaLogo} className="headerLogoImg" ></img>
              <p style={{ fontSize: 30 + "px" }}>HACK THE FUTURE</p>
              <div style={{ fontSize: 25 + "px" }} className="textTwo color">4. - 7.5.20</div>
            </div>
          </div>
          <div className="wrapperTwo">

             <div className="flexbox1 flexbox">
            <div className="wrapperTwo-flexbox1-left">
                <div>Everyone has the X factor</div>
            </div>
              {/* <div style={{width:20+'px'}}></div> */}
            <div className="wrapperTwo-flexbox1-right">
                <div>
                We organize events for a wide variety of skill levels and backgrounds - check out our event calendar and specs for each event! Whether you're interested in getting started with your tech journey, learning more or really testing your skills, we've got something for you.
                </div> <br/>
                <div>
                Junction events are organized throughout the year, including JunctionX hackathons around the world. 
                The winning team for JunctionX Singapore will get the opportunity to go to the annual main event in Finland: next up, Junction 2020!
                If you’re into tech at all, it is the place to be – a full weekend of hacking with around other tech heads & hustlers in an awesome venue and atmosphere like no other.
                An experience you do not want to miss out on. Stay tuned for more information!
                </div>
            </div>
          </div>
       
          </div>
        </div>

        <Footer />
      </div>
    );
  }
}

export default JxSingapore2019;
